package br.com.ifet.classes;

public class AtividadeFor {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<10;i++){
			
			for(int x=0;x<10;x++){
				
				for(int y=0;y<10;y++){
					System.out.print("Valor: " + i);
					System.out.print(x);
					System.out.println(y);
				}
			}
		}
			

	}

}
